findStrings.find:
\{


 \$file \= \$path_out\."stability\.contigs\.groups"\;

 \$data_w \= array\(\)\;
 \$lines \= file\(\$file\)\;

 foreach\(\$lines as \$line\) \{

 \$out \= explode\("\t"\, \$line\)\;
 \$out\[1\] \= str_replace\("\-"\, "_"\, \$out\[1\]\)\;

 \$data \= \$out\[0\]\."\t"\.\$out\[1\]\;
 array_push\(\$data_w\,\$data\)\;
 \}

 file_put_contents\(\$file\, \$data_w\)\;

 screen_summary\(\$user\,\$project\,\$path_in\,\$path_out\)\;
 \}
